import React from 'react';
import './EventCard.css';

const EventCard = ({ event }) => {
  return (
    <div className="event-card">
      <img src={event.image_url} alt={event.name} className="event-image" />
      <h3>{event.name}</h3>
      <p>{event.oneliner?.text}</p>
      <div className="traders">
        <span>{event.traders_count_numeric} traders</span>
      </div>
      <div className="actions">
        <button className="yes" style={{ backgroundColor: event.buy_button.bg_color, color: event.buy_button.text_color }}>
          {event.buy_button.text}
        </button>
        <button className="no" style={{ backgroundColor: event.sell_button.bg_color, color: event.sell_button.text_color }}>
          {event.sell_button.text}
        </button>
      </div>
      <div className="expiry">
        <p>{event.expiry_date}</p>
      </div>
    </div>
  );
};

export default EventCard;
